import React from "react";
import "./App.css";
import OurService from "./component/OurService-component/OurService";
import OurProject from "./component/OurProject/OurProject";
import DesignProcess from "./component/DesignProces-component/DesignProcess";
import Form from "./component/form/Form";
import Client from "./component/clients-component/Company";
import OurService2 from "./component/our-service2-component/OurService2";
import Td from "./component/Td/Td";
import Gd from "./component/Gd/Gd";
import Ch from "./component/ch/Ch";

function App() {
  return (
    <div>
      <section className="sec1">
        <OurService />
      </section>
      <section className="sec2">
        <OurProject />
      </section>
      <section className="sec3">
        <DesignProcess />
      </section>

      <section className="sec5">
        <Form />
      </section>
      <section className="sec6">
        <Client />
      </section>
      <section className="sec7">
        <OurService2 />
      </section>
      <section className="sec8">
        <Td />
      </section>
      <section className="sec9">
        <Gd />
      </section>
      <section className="sec10">
        <Ch />
      </section>
    </div>
  );
}

export default App;
